\r\n A Timestamp represents:
 时间戳表示独立于任何时区或本地的时间点
 日历，编码为秒数和秒数
 纳秒分辨率。 计数是相对于UTC午夜的一个纪元
 1970年1月1日，在公历延长
 公历倒退到第一年。

 所有分钟都是60秒长。 闰秒被"涂抹"，以便没有飞跃
 需要第二个表进行解释，使用[24小时线性
 涂抹](https://developers.google.com/time/smear)。

 范围是从0001-01-01T00:00:00Z到9999-12-31T23:59:59.99999999Z。
 限制在该范围内，我们确保我们可以转换为[RFC
 3339](https://www.ietf.org/rfc/rfc3339.txt）日期字符串。

 #例子

 示例1：从POSIX`time()`计算时间戳。

     Timestamp时间戳;
     时间戳。set_seconds(time(NULL));
     时间戳。set_nanos(0);

 示例2：从POSIX`gettimeofday()`计算时间戳。

     结构时间电视;
     gettimeofday(&tv,NULL);

     Timestamp时间戳;
     timestamp.set_seconds(tv.tv_sec);
     timestamp.set_nanos(tv.tv_usec*1000);

 示例3：从Win32`GetSystemTimeAsFileTime()`计算时间戳。

     文件时间ft;
     GetSystemTimeAsFileTime(&ft);
     UINT64蜱=(((UINT64)英尺。dwHighDateTime）<<32）/ft。[医]时间;

     //Windows刻度为100纳秒。 视窗时代1601-01-01T00:00:00Z
     //是Unix epoch1970-01-01t00:00:00z之前的11644473600秒。
     Timestamp时间戳;
     时间戳。set_seconds（（INT64）（（蜱/10000000）-11644473600LL））;
     时间戳。set_nanos（（INT32）（（蜱％10000000）*100））;

 示例4：从Java系统计算时间戳。currentTimeMillis()`。

     长米利斯=系统。当前时间（）;

     时间戳timestamp=时间戳。newBuilder（）。设定秒(millis/1000)
         .setNanos((int)(((%1000)*1000000))。建造();

 示例5：在Python中从当前时间计算时间戳。

     时间戳=时间戳()
     时间戳。GetCurrentTime()

 #JSON映射

 在JSON格式中，时间戳类型被编码为
 [RFC3339]（https://www.ietf.org/rfc/rfc3339.txt)格式。 也就是说，
 格式为"{year}-{month}-{day}T{hour}:{min}:{sec}[。{frac_sec}]Z"
 其中{年}总是用四位数字表示，而{月}，{日},
 {hour}、{min}和{sec}均为零填充，每个数字为两位。 分数
 秒，最高可达9位数（即最高可达1纳秒分辨率）,
 是可选的。 后缀"Z"表示时区("UTC")；时区
 是必需的。 Proto3JSON序列化程序应始终使用UTC（如下所示
 "Z"）打印时间戳类型时，proto3JSON解析器应该是
 能够接受UTC和其他时区（如偏移量所示）。

 例如，"2017-01-15t01:30:15.01Z"编码过去15.01秒
 01:30UTC在一月15,2017.

 在JavaScript中，可以使用
 标准
 [toISOString()](https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Date/toISOString)
 方法。 在Python中，一个标准的'datetime。datetime'对象可以转换
 使用此格式
 ['strftime'](https://docs.python.org/2/library/time.html#time.strftime）与
 时间格式规范'%Y-%m-%dT%H:%M:%S.%fZ'. 同样，在Java中，可以使用
 Joda时间的['ISODateTimeFormat.日期时间()`](
 http://www.joda.org/joda-time/apidocs/org/joda/time/format/ISODateTimeFormat.html#dateTime%2D%2D
 )获得能够以该格式生成时间戳的格式化程序。

\r\n Asynchronously executes:
 异步对数据库执行给定的DDL/DML命令。

 与接受SQL的任何API一样，参数化任何用户输入以防止SQL注入攻击都很重要。您可以在SQL查询字符串中包含参数位置持有人，然后作为其他参数提供参数值。您提供的任何参数值都会自动转换为dbParameter。
 context.database.executesqlcommandasync（“ update dbo.posts设置额定值= 5 where where = @p0”，useruppliedauthor）;
 另外，您还可以构造DBPARAMETER并将其提供给SQLQUERY。这使您可以在SQL查询字符串中使用命名参数。
 context.database.executesqlcommandasync（“ update dbo.posts set级级= 5 where where fureated = @author”，new sqlparameter（“ @fureated”，useruppliedauthor））;

\r\n Whether the message is:
 该消息是否是自动生成的地图条目类型
 地图字段。

 对于地图字段：
     映射<keytype，valueType> map_field = 1;
 解析的描述符看起来像：
     消息mapfieldentry {
         选项map_entry = true;
         可选的键盘键= 1;
         可选的ValueType值= 2;
     }
     重复mapfieldentry map_field = 1;

 实现可能选择不生成map_entry = true消息，而是
 使用目标语言中的本机映射来保存键和值。
 此类实施中的反射API仍然需要作为
 如果字段是重复的消息字段。

 注意：请勿在.proto文件中设置选项。始终使用地图语法
 反而。该选项应仅由原始编译器隐式设置
 解析器。

\r\n `Any` contains an arbit:
 'Any'包含任意序列化的协议缓冲区消息以及
 描述序列化消息类型的URL。

 Protobuf库支持打包/解压缩表单中的任何值
 任何类型的效用函数或附加生成的方法.

 示例1：用C++打包和解包消息。

     Foo foo=。..;
     任何任何;
     任何。包装(foo);
     ...
     如果（有的话。UnpackTo(&foo)){
       ...
     }

 示例2：在Java中打包和解包消息。

     Foo foo=。..;
     Any any=Any.包(foo);
     ...
     如果（any.is（Foo.class)){
       foo=任何。解包(Foo.类）;
     }

  示例3：在Python中打包和解包消息。

     foo=Foo（。..)
     任何=任何()
     任何。包(foo)
     ...
     如果any.Is（Foo.DESCRIPTOR）:
       任何。解包(foo)
       ...

  示例4：在Go中打包和解包消息

      foo:=&pb。Foo{...}
      任何，err：=ptypes。MarshalAny(foo)
      ...
      foo:=&pb。[美]美
      如果err：=ptypes。UnmarshalAny(any,foo);err!=nil{
        ...
      }

 Protobuf库提供的pack方法默认会使用
 'type.googleapis.com/full.type.name'作为类型URL和解包
 方法只在最后一个'/'之后使用完全限定的类型名称
 在类型URL中，例如"foo.bar.com/x/y.z"会产生类型
 名称"y.z"。

 JSON格式
 ====
 "Any"值的JSON表示使用常规
 反序列化的嵌入式消息的表示，具有
 包含类型URL的附加字段`@type'。 例子：:

     包谷歌。个人资料;
     留言人{
       字符串first_name=1;
       字符串last_name=2;
     }

     {
       "@类型":"type.googleapis.com/google.profile.Person",
       "名字":<字符串>,
       "姓氏":<字符串>
     }

 如果嵌入的消息类型是众所周知的，并且具有自定义JSON
 表示，该表示将被嵌入添加一个字段
 除了"@type"之外，还保存自定义JSON的"value`
 场。 例（对于消息[谷歌。protobuf。持续时间][]):

     {
       "@类型":"type.googleapis.com/google.protobuf.Duration",
       "价值":"1.212s"
     }

\r\n A Duration represents a:
 持续时间代表代表的签名的固定长度跨度
 作为纳秒秒的秒和秒数的计数
 解析度。它独立于“日”等日历和概念
 或“月”。它与时间戳有关，因为
 两个时间戳值是持续时间，可以添加或减去
 来自时间戳。范围约为 +-10，000年。

 ＃ 例子

 示例1：计算伪代码中两个时间戳的持续时间。

     时间戳开始= ...;
     时间戳末端= ...;
     持续时间= ...;

     持续时间。
     持续时间nanos = end.nanos -start.nanos;

     if（lisation.seconds <0 && duration.nanos> 0）{
       持续时间 += 1;
       持续时间。Nanos-= 1000000000;
     } else if（lisation.seconds> 0 && duration.nanos <0）{
       持续时间。第二-= 1;
       持续时间 += 1000000000;
     }

 示例2：计算伪代码中时间戳 +持续时间的时间戳。

     时间戳开始= ...;
     持续时间= ...;
     时间戳末端= ...;

     end.seconds = start.seconds + duration.seconds;
     end.nanos = start.nanos + duration.nanos;

     if（end.nanos <0）{
       end.seconds- = 1;
       end.nanos += 1000000000;
     } else if（end.nanos> = 1000000000）{
       end.seconds += 1;
       end.nanos- = 1000000000;
     }

 示例3：python中的dateTime.timedelta的持续时间。

     td = datetime.timedelta（天= 3，分钟= 10）
     持续时间=持续时间（）
     持续时间。Fromtimedelta（TD）

 ＃JSON映射

 以JSON格式，持续时间类型被编码为字符串，而不是
 对象，字符串在后缀“ s”（指示秒）中结束
 在秒数之前，纳秒秒表示为
 分数秒。例如，使用0纳秒的3秒应为
 以JSON格式编码为“ 3s”，而3秒和1纳秒应
 以JSON格式表示为“ 3.000000001s”，以及3秒和1
 微秒应以JSON格式表示为“ 3.000001s”。

\r\n If this SourceCodeInfo:
 如果此SourceceCodeInfo代表完整的声明，则这些是任何
 在声明之前和之后出现的评论似乎是
 附在声明上。

 连续的一系列评论出现在连续的线上，没有其他
 出现在这些行上的令牌将被视为单一评论。

 领导_detached_comments将保留出现的评论段落
 在（但未连接到）当前元素之前。每个段落，
 用空线隔开，将是重复中的一个注释元素
 场地。

 仅提供评论内容；评论标记（例如//）是
 剥离出来。对于块评论，领先的空格和星号
 将从每行的开头剥离，而不是第一行。
 新线包含在输出中。

 例子：

   可选的INT32 FOO = 1; //附带的评论。
   //附带的评论。
   可选的INT32 bar = 2;

   可选字符串baz = 3;
   //与BAZ有关的评论。
   //与BAZ相连的另一行。

   //附加到Qux的评论。
   //
   //附加到Qux的另一行。
   可选双Qux = 4;

   //对Corge的独立评论。这不是领导或尾声
   //到Qux或Corge，因为有空白的线将其与
   // 两个都。

   // Corge第2段的独立评论。

   可选的字符串corge = 5;
   /*附加的块评论
    *到科吉。领先的星号
    *将被删除。 */
   /*附带的块评论
    *格鲁特。 */
   可选的INT32 GRAULT = 6;

   //忽略了独立的评论。

\r\n Declares an API Interfa:
 声明要包含在此接口中的API接口。 包括
 接口必须从包含的接口重新声明所有方法，但是
 文档和选项继承如下:

 -如果在注释和空格删除后，文档
   redeclared方法的string为空，它将被继承
   从原来的方法。

 -属于服务配置的每个注释（http,
   visibility)未在redeclared方法中设置的将是
   继承的。

 -如果继承了http注释，路径模式将是
   修改如下。 任何版本前缀将被替换
   包括接口的版本加上[根][]路径，如果
   指定。

 一个简单的mixin的例子:

     包谷歌。acl。v1;
     服务访问控制{
       //获取底层ACL对象。
       rpc GetAcl(GetAclRequest)返回(Acl){
         选项（谷歌。空气污染指数。http）。get="/v1/{资源=**}:getAcl";
       }
     }

     包谷歌。存储。v2;
     服务存储{
       rpc GetAcl(GetAclRequest)返回(Acl);

       //获取数据记录。
       rpc GetData(GetDataRequest)返回(数据){
         选项（谷歌。空气污染指数。http）。获取="/v2/{资源=**}";
       }
     }

 Mixin配置示例:

     空气污染指数:
     -名称：谷歌。存储。v2．储存库
       混合,混合:
       -名称：谷歌。acl。v1．访问控制

 Mixin构造意味着'AccessControl'中的所有方法都是
 也声明具有相同的名称和请求/响应类型
 '存储'。 文档生成器或注释处理器将
 见的有效'存储。GetAcl'继承后的方法
 文档和注释如下:

     服务存储{
       //获取底层ACL对象。
       rpc GetAcl(GetAclRequest)返回(Acl){
         选项（谷歌。空气污染指数。http）。get="/v2/{资源=**}:getAcl";
       }
       ...
     }

 请注意路径模式中的版本如何从`v1'更改为'v2'。

 如果指定了mixin中的`root'字段，它应该是
 放置继承HTTP路径的相对路径。 例子：:

     空气污染指数:
     -名称：谷歌。存储。v2．储存库
       混合,混合:
       -名称：谷歌。acl。v1．访问控制
         根：acl

 这意味着以下继承的HTTP注释:

     服务存储{
       //获取底层ACL对象。
       rpc GetAcl(GetAclRequest)返回(Acl){
         选项（谷歌。空气污染指数。http）。get="/v2/acls/{资源=**}:getAcl";
       }
       ...
     }
